import "./Score.css";
import Card from "./Card";

const Score = ({ scoreData, keys }) => {
  // for (let i = 0; i < scoreData.length; i++) {
  //   console.log(scoreData[i]);
  // }

  // console.log(scoreData[0].team)

  <div>
    {scoreData.map((sd) => {
      return <Card key={sd.team} />;
    })}
  </div>;
};

export default Score;
